window.bookSummaryJSON = "<p><b>Fate plays funny games.</b></p> <p>It crowned me a princess, then ripped it away overnight. It gave me the determination to restore my family name, despite the hatred of my kind throughout the kingdom. It gave me the courage to walk through the gates of Heir Academy and fight for what's mine.</p> <p>But the funny thing about fate is, that no matter how much I want to take the reins, it has its own plan for me. This journey has led me through trials and up against enemies I could have never foreseen.</p> <p>Despite all this lies a glimmer of hope in four men I never saw coming.</p> <p>Raiden. Kryll. Brody. Cassian.</p> <p>For better or worse, fate has brought us together and I can no longer fight it.</p> <p>The hunt for the crown has commenced. Only time will tell what fate has in store for me.</p>"; 
